import React from "react";
import Todo from "./Todo";
const TodoList = ({ todos, setTodos }) => {
  return (
    <div>
      {todos.map((todo) => (
        <ul>
          <li>
            <Todo key={todo.id} stodo={todo} />
          </li>
        </ul>
      ))}
    </div>
  );
};

export default TodoList;
